1. The entirety of the requested footage is publicly available, so the HCSO will not be providing the footage in response to this request; 
2. The HCSO does not possess security camera footage for East Ridge High School, so the requestor will need to request that from the Hamilton County Department of Education; 
3. The HCSO does not possess 911 calls related to the incident, so the requestor will need to request those from HC911; 
4.  The HCSO does not possess photographs of the incident; 
5. The HCSO does not possess charging documents, so the requestor will need to request those from the Hamilton County District Attorney's Office; and
6. Press releases are publicly available, so the HCSO will not be providing those in response to this request.

